import React from 'react';
import './Game.css';

const game = (props) => {
    return (
        <div className="game">
            <div className="gameDetails">
                    <div className="gameTime"><p>7:00PM</p></div>
                    <div className="gameVenue"><p>NBISC 2</p></div>
            </div>
            <div className="gameSection">
                <div className="teamName">{props.homeTeam}</div>
            </div>
            <div className="gameSection">
                <div className="teamName">{props.awayTeam}</div>
            </div>               
            <div className="gameSection">
                <div className="dutyTeam">Duty: Duty Team</div>
            </div>
        </div>
    )
}

export default game;
